import React from 'react';
import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/header"

function App() {
  return (
    <Provider store={store}>
    <div className="App">
    <div className="font-bold text-center p-4 text-[23px] bg-slate-600 text-lime-300">Hello, #ca2626 Lobster!</div>
      <div>
        <div>
          <div>
            <HeaderComponent/>
          </div>
        </div>
      </div>

    </div>
  </Provider>
  );
}

export default App;
